#This is config of Furniture Shop Plugin

#Will plugin use PlayerPoints plugin as main currency? if PlayerPoints plugin is not installed it will use Vault instead
usePlayerPoints: false

#Location of Preview Furniture and WorldGuard Region to define where shop area is
Location:
  #World guard Area defines where shop area is (where player able to LeftClick to open shop)
  Region: furniture
  #Location defines where Furniture preview is
  Preview:
    World: spawn
    X: 289.5
    Y: -10
    Z: -132.5
  #if amount of player in this radius is less than 1 the system will not preview the furniture
  checkDistance: 20

Items:
  NextPage:
    Item: PAPER
    Name: "&aNext Page"
    Lore: []
    ModelData: 10802
  PreviousPage:
    Item: PAPER
    Name: "&cPrevious Page"
    Lore: []
    ModelData: 10801
  Accept:
    Item: PAPER
    Name: "&f胧 &aยืนยันการซื้อ"
    Lore: []
    ModelData: 10806
  Deny:
    Item: PAPER
    Name: "&f胈 &cยกเลิกการซื้อ"
    Lore: []
    ModelData: 10804
  BuyWithPoints:
    Item: MAGENTA_STAINED_GLASS_PANE
    Name: "&f胧 &dซื้อด้วยพ้อย"
    Lore: []
    ModelData: 0
  BuyWithVault:
    Item: LIME_STAINED_GLASS_PANE
    Name: "&f胧 &aซื้อด้วยเงิน"
    Lore: []
    ModelData: 0

Language:
  #Hex color format is #ffffff
  #Example: 
  PlayerPoints: 10
  Vault: #ff0000<price>
  #Available Placeholder: <price>

  #Lore in main shop
  Shop-Lore:
    - ' '
    - '&f &eคลิกซ้าย: &fเพื่อดูตัวอย่างเฟอร์นิเจอร์'
    - '&aSHIFT &f+  &eคลิกซ้าย &bเพื่อทำการซื้อ'

  #Lore in confirmation page
  Confirmation-Lore:
    - ' '
    - '&fนี่คือไอเท็มที่คุณต้องการซื้อหรือไม่'
    - '&f胧 หากซื้อ ให้กดปุ่ม &aสีเขียว &fและทำการซื้อ'
    - '&f胈 หากไม่ซื้อ ให้กดปุ่ม &cสีแดง &fและทำการยกเลิก'

  #Message that will send to player when they have not enough inventory
  Not-Enough-Inventory: '&f &cช่องเก็บของในตัวคุณไม่เพียงพอ'
  #Message that will send to player when they have not enough money
  Not-Enough-Money: '&f &cไม่สามารถซื้อได้เนื่องจากคุณมีเงินไม่เพียงพอ!'
  #Message that will sebd to player when they buy a furniture
  Succeeded: '&f &aคุณได้ซื้อ &e<item> &aเรียบร้อยแล้ว!'
  #Message that will send to player when they press preview mode button
  Preview-Message: '&f &aคุณได้เริ่มการดูตัวอย่างของ &e<item> &aแล้ว'

  #Confirmation page GUI Name
  Confirmation-GUI-Name: '&1Buying Confirmation'
  #Main shop GUI Name
  Shop-GUI-Name: '&f'
    #Vault currency
  Vault: $
  #PlayerPoints Currency
  PlayerPoints: พ้อย
  #Single Currency
  Single: '&fราคา &e<price>'
  #Supports both currency
  Both: "&e<vault> &fหรือ &d<playerpoints>"


